// src/pages/PropertyList.js

import React from 'react';

const PropertyList = () => {
  return (
    <div>
      <h1 className="text-3xl font-bold mb-4">Browse Properties</h1>
      {/* Dummy listings for now */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {[1, 2, 3].map((item) => (
          <div
            key={item}
            className="border rounded-xl p-4 shadow hover:shadow-lg transition"
          >
            <h2 className="text-xl font-semibold">Property #{item}</h2>
            <p className="text-gray-600">Location: Ludhiana</p>
            <p className="text-gray-600">Price: â‚¹50 Lakh</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default PropertyList;
